import axios from 'axios';
import { useEffect, useState } from 'react';

const GetApi = () => {
    const[newData,setNewData] = useState([]);

        axios.get('http://localhost:3001/Profiles')
        .then((result) => {
            result.json().then((resp)=>{
                setNewData({
                    newData : resp,
                })
            })
        })  
        .catch(error => {
            console.log(error);
        });


    return(
        <>
        <div>
        {
            newData.map((e)=>
            <tr>
                <td>{e.id}</td>
                <td>{e.name}</td>
                <td>{e.place}</td>
                <td>{e.contact}</td>
            </tr>)

            }
        </div>
        </>
    )
}

export default GetApi;
